INSERT INTO `produto` VALUES (1,'New Belgium Fat Tire Amber Ale - Lata 355ml','A Cerveja Americana New Belgium Fat Tire Amber Ale é uma cerveja de coloração âmbar, corpo médio e espuma de boa formação. Apresenta notas de malte tostado e caramelo perfeitamente equilibradas com o frescor do lúpulo. Estilo: Amber Ale Teor Alcoólico: 5,2% Volume: 355 ml',19.9,1,96,_binary 'data:application/octet-stream;base64,'),(2,'New Belgium Voodoo Ranger IPA - Lata 355ml','A cerveja Americana New Belgium Voodoo Ranger IPA é uma India Pale Ale que leva em sua receita os lúpulos Nugget, Cascade, Simcoe, Chinook, Mosaic e Amarillo. Apresenta coloração dourada, espuma de boa formação, corpo médio com notas nos aromas e sabores que remetem ao frutado, cítrico e floral. Seu final é refrescante e com perfeito amargor. Estilo: American IPA Teor Alcoólico: 7% Volume: 355 ml',21.9,1,99,_binary 'data:application/octet-stream;base64,'),(3,'Courage Imperial Russian Stout - Garrafa 275 ml','Essa Russian Imperial Stout, possui coloração escura profunda, corpo bastante robusto e com boa formação de espuma. Produzida apenas uma vez por ano, esta cerveja de guarda que fica ainda melhor depois de 13 anos, apresenta sabor torrado, encorpado e com amargor bem equilibrado. Seu aroma frutado traz notas de café torrado, chocolate e leve frescor defumado. Estilo: Russian Imperial Stout Teor Alcoólico: 10% Volume: 275 ml',32.9,1,98,_binary 'data:application/octet-stream;base64,'),(4,'Newcastle Brown Ale - Garrafa 550ml','Fermentada pela primeira vez em 1927 pelo coronel Jim Porter Newcastle Brown Ale alcançou um sucesso imediato com os juízes do campeonato internacional de fermentação de 1928, quando ganhou o campeonato de cerveja. Desde então a marca não parou de crescer dentro do Reino Unido Recentemente Newcastle Brown Ale recebeu um indicador de proteção geográfica, símbolo da União Européia. Isto significa que só a Newcastle Brown Ale fermentada em Newcastle–Upon–Tyne pode ser chamada de Newcastle Brown Ale.    Família: Ale    Estilo: Brown Ale    Teor Alcoólico: 4,7%    Volume: 550ml    Origem: Inglaterra',29.99,1,100,_binary 'data:application/octet-stream;base64,'),(5,'Aecht Schlenkerla Rauchbier Weizen - Garrafa 500ml','Aecht Schlenkerla Rauchbier Weizen (pronúncia: écht xlenkérla rauchbier) é a cerveja mais tradicional do tipo \"Rauchbier\" da Alemanha. É fabricada desde 1678 na cidade de Bamberg, no Estado alemão da Baviera. Tem graduação alcoólica de 5,2% e a sua temperatura ideal para apreciação é de 7-8°C. Cerveja de coloração acobreada, produzida com trigo e maltes defumados. No aroma e no sabor, notas de banana, cravo e defumado intenso. Perfeita com carnes defumadas. Estilo: Weizen Rauchbier Teor alcoólico: 5,2%vol Volume: 500 ml  ',34.99,1,100,_binary 'data:application/octet-stream;base64,'),(6,'Konig Pilsener - 500 ml','Referência mundial no estilo german pilsener, possui cor dourada clara e espuma consistente. É leve, refrescante e amargor presente. Fundada em 1858 por Theodor König na cidade de Duisburg-Beeck. No primeiro ano, a produção foi de 206 hectolitros e a maior parte foi vendida nas cidades próximas. Após mais de 150 anos, hoje a KÖNIG PILSENER (tradução REI DAS PILSNERS) é uma cerveja que se posiciona como uma das melhores recompensas ao final de um bem sucedido dia de trabalho, encontrada em locais de ótimo padrão e consumida para comemorar grandes conquistas. Harmonização: Aperitivo, pães, queijos leves, saladas, azeitonas verdes, amêndoas, canapés frios, carnes brancas pouco gordurosas, pratos leves. Estilo: German Pilsener Teor alcoólico: 4,9% Volume: 500 ml',19.9,1,100,_binary 'data:application/octet-stream;base64,'),(7,'Averbode Ale - Garrafa 330ml','Averbode é uma autêntica cerveja de abadia do estilo Belgian Blond Ale produzida pela fábrica da Delirium para os monges da Abadia de Averbode, de 1134. É o resgate da tradição histórica de Averbode, que produziu cervejas do século XIV até o século XX. Uma cerveja artesanal multigrãos fina e elegante, feita com malte de cevada, aveia e espelta, com dryhopping e refermentação na garrafa, que deixa a cerveja mais frutada, fresca e frisante. Coloração amarelo intenso, levemente turva e com boa formação de espuma.   Família: Ale Estilo: Belgian Blond Ale Teor Alcoolico: 7.5% Volume: 330 ml',25.9,1,100,_binary 'data:application/octet-stream;base64,'),(8,'Blanche de Neiges Witbier - Garrafa 330ml','A Branca de Neve tem as bases de uma Blanche tradicional, com um volume de 5% de álcool. A Blanche é, no entanto, diferente no sabor em relação aos seus homólogos, principalmente por uma profunda amargura sobre um buque de aromas perfumados exóticos. Possui uma leve sensação de curaçao e um amargor de raspas de casca de laranja. Algumas especiarias de bom gosto a torna bastante refrescante. La Blanche des Neiges, não tem acidez pronunciada o que faz dela uma Blanche bastante original e muito refrescante. Sua cor é muito importante, pois é muito clara, mas ainda nebulosa. Estilo: Witbier Teor Alcoólico: 5% Volume: 330 ml Cervejaria: Huyghe',18.9,1,100,_binary 'data:application/octet-stream;base64,'),(9,'Coruja Lager - Garrafa 355ml','A Coruja Lager é uma cerveja de baixa fermentação, refrescante e equilibrada e muito fácil de beber. Tem a aparência de coloração dourado clara, límpida e de colarinho branco e persistente. Levemente seca, mas com o equilíbrio entre o malte e o lúpulo, esse produto é perfeito para brindar com os amigos e matar a sede durante longos períodos. Estilo: American Lager Teor Alcoólico: 4.6% Volume: 355 ml',11.99,1,100,_binary 'data:application/octet-stream;base64,'),(10,'Coruja Strix Extra Munich Helles - Garrafa 500ml','Produzida em Forquilhinha (SC), a gaúcha Coruja Strix é uma cerveja acobreada, de sabor acentuado e aroma diferenciado é marcante já no primeiro gole. Força dos maltes especiais e refrescância no mix de lúpulos.         Amargor: 25 IBU Densidade Original: 16% º P Harmonizar com frutos do mar, peixes, carnes defumadas e queijos semiduros. 6,5% vol. Volume: 500ml',20.99,1,100,_binary 'data:application/octet-stream;base64,'),(11,'BrewDog Punk IPA - Lata 330ml','De coloração âmbar com leve turbidez, possui creme de boa formação e estabilidade. No aroma, uma explosão de lúpulos cítricos, lembrando frutas como kiwi, lichia e maracujá. O malte aparece em segundo plano, formando um conjunto equilibrado. Seca e adstringente, seu final é bastante amargo.   Estilo: India Pale Ale Teor Alcoólico: 6.0%   Volume: Lata - 330 ml IBU: 68',17.9,1,100,_binary 'data:application/octet-stream;base64,'),(12,'Brewdog Dead Pony Ale - Lata 330ml','American Pale Ale da escocesa Brewdog produzida com generosas quantidades de lúpulos califórnianos para dar um toque cítrico potente e marcante. A base de maltes tostados, dá lugar ao frescor picante do lúpulo, que lembra frutas tropicais e garante uma ótima drinkability. Família: Ale Estilo: American Pale Ale  Teor Alcoólico: 3,8% Volume: 330 ml',17.9,1,100,_binary 'data:application/octet-stream;base64,'),(27,'Aguardente Sagatiba Amarela 700ml','A cachaça Sagatiba Velha é produzida a partir de lotes limitados e exclusivos da melhores cachaças artesanais mineiras, destiladas em alambique de cobre, e envelhecidas em barris de carvalho no interior de São Paulo por um período mínimo de 2 anos. O resultado é uma cachaça excepcional, um líquido dourado, com aroma frutado e um sabor encorpado, que traduz todo o cuidado e atenção que uma cachaça merece, em seus mínimos detalhes.',72.7,3,3,_binary 'data:application/octet-stream;base64,'),(28,'Cachaça Leblon Signature Merlet 375ml','O melhor sabor da cana com aroma e qualidade do carvalho mais fino. Este produto foi extraído de uma edição em Madeira Limousin, até ser habilmente mixado por Gilles Merlet. Destilado em lotes únicos em casacos de alambique. O resultado é uma cachaça complexa e suave, com notas de mel, caramelo e pinhão.',57.1,2,3,_binary 'data:application/octet-stream;base64,'),(29,'Cachaça 51 Reserva Rara 700ml','A incansável busca pela perfeição foi a inspiração para a criação da Reserva 51 Rara. Uma verdadeira obra de arte feita para ser apreciada e harmonizada com bons momentos. Prepare-se para degustar com todos os sentidos cada detalhe desta obra-prima. A cachaça Reserva 51 Rara é uma bebida destilada das mais nobres variedades de cana-de-açúcar, envelhecida em barris de carvalho americano e finalizada em barris de carvalho europeu que foram usados para produzir os mais complexos vinhos da América do Sul. O resultado de tanto trabalho e dedicação é uma cachaça de paladar extraordinariamente rico e suave, complementado por notas de frutas vermelhas.',145.5,2,2,_binary 'data:application/octet-stream;base64,'),(30,'Cachaça 51 Luxo Bruta 965ml','Feita para ser apreciada em doses, drinks e até mesmo em receitas gastronômicas. Cada etapa do processo produtivo da cachaça é feito cuidadosamente pela 51. Desde o preparo do solo, passando pela escolha da cana até a destilação. Sabor, aroma e equilíbrio, que une excelência, boas práticas e sustentabilidade.',8.3,2,7,_binary 'data:application/octet-stream;base64,'),(31,'Cachaça Havana 600ml','HAVANA é fabricada em Salinas-MG, capital da cachaça artesanal, desde 1943. A cachaça Havana detém vários títulos de melhor cachaça do Brasil. A cachaça Havana é envelhecida 10 anos em tonéis de bálsamo, e sua produção é limitada o que garante sua alta qualidade além de tornar a bebida um verdadeiro objeto de desejo.',623,2,2,_binary 'data:application/octet-stream;base64,'),(32,'Cachaça Seleta Mix 1L','Uma das bebidas alcoólicas puras mais saborosas do mundo. Quem já experimentou a Seleta Mix sabe que o seu sabor combina perfeitamente com frutas cítricas, vermelhas, licores, brandy e muito mais.',34.2,2,4,_binary 'data:application/octet-stream;base64,'),(33,'Cachaça 51 Reserva Unica 700ml','Em junho de 2009 em comemoração aos 50 anos da Cia Müller, foi lançada a Reserva 51, que durante muitos anos pertenceu exclusivamente à reserva pessoal do Sr. Guilherme Müller Filho, o Seu Ézio. Dono de um paladar apurado, ele desenvolveu uma cachaça com perfeito equilíbrio entre aroma, sabor e cor. E assim nasceu a Reserva 51 Única, uma cachaça extra premium, envelhecida em barris de carvalho e elaborada com todo o cuidado e dedicação. A Reserva 51 Única é uma bebida destilada das mais nobres variedades de cana-de-açúcar e envelhecida exclusivamente em barris de carvalho americano. O resultado é uma cachaça de paladar macio com um buquê inconfundível.',145.5,2,3,_binary 'data:application/octet-stream;base64,'),(18,'Aguardente Velho Barreiro Cafe 910ml','A combinação entre as bebidas mais apreciadas pelos brasileiros: a Cachaça e o Café e, traduzida na expressão que revela um dos mais puros sentimentos humanos que é o “desejo”. Identificando uma excelente oportunidade no mercado consumidor e atendendo positivamente ao que foi constatado em pesquisa, apresentamos o coquetel alcoólico V.B. Desejos Sabor Café aprovado integralmente por aqueles que curtem uma boa ‘cachaça’ e também não abrem mão do tradicional ‘cafezinho’, na leitura e palavra deles próprios: “uma combinação gostosa e feliz!”',24.9,3,2,_binary 'data:application/octet-stream;base64,'),(19,'Aguardente Nega Fulo 1827 Jequitiba 750ml','A série especial originária da mesma Fazenda de Nêga Fulô, uma linha de autênticas cachaças armazenadas em tonéis de madeiras brasileiras, trazendo os aromas e sabores exclusivos dessas madeiras. Jequitibá: De cor levemente amarelada, macia e envolvente, destacando toda a pureza da cana.',72.7,3,2,_binary 'data:application/octet-stream;base64,'),(20,'Aguardente Velho Barreiro Composta 910ml','A empresa surgiu na década de 1950 em Piracicaba com a marca Tatuzinho. Ela se mostrou uma das mais importantes do segmento devido a suas 3 marcas: Tatuzinho, Velho Barreiro e 3 Fazendas. Tendo se destacado a Velho Barreiro. Atualmente, a empresa se destaca como uma das principais exportadoras de cachaças do Brasil, tendo criado as versões especiais da Velho Barreiro para competir no mercado internacional.?',10.4,3,3,_binary 'data:application/octet-stream;base64,'),(21,'Aguardente Velho Barreiro Ouro 700ml','A partir do ano de 2005, a fim de incrementar seu elenco de produtos “ premium ”, desenvolveu a Velho Barreiro Edição Especial Ouro em uma embalagem exclusiva de 700 ml totalmente dourada, que lhe conferiu o “Prêmio Embanews” no mesmo ano. Visando impactar o público consumidor apreciador de cachaças amarelas também compostas através da combinação de envelhecida com a branca tradicional, apostou em canais diferenciados de compra e venda.',57.1,3,1,_binary 'data:application/octet-stream;base64,'),(22,'Aguardente Velho Barreiro Diamond 700ml','Velho Barreiro entra para o restrito ranking de bebidas mais valiosas do mundo, com o lançamento da \"Velho Barreiro Diamond\", a \"Cachaça Mais Cara do Mundo\". A embalagem foi desenhada pelo fabricante de cristais e garrafas especiais Saverglass, de Paris, resultando em uma elegante garrafa Axel. A \"Velho Barreiro Diamond\" incorpora em cada detalhe de seu design a estética da arte requintada, pois o recipiente é feito de uma armação toda em prata e ouro e cravejada por nada menos que 211 brilhantes, mais um diamante de 0.70 quilate incrustado no centro do rótulo da embalagem, totalizando 7,3 quilates de pureza cristalina.',258960,3,1,_binary 'data:application/octet-stream;base64,'),(23,'Aguardente Cachaça Indaiazinha 600ml','A cachaça Indaiazinha é produzida por Valdete Romualdo da Silva na fazenda Sobradinho, na Serra dos Bois, zona rural de Salinas - Minas Gerais. A cachaça Indaiazinha foi lançada no mercado em 1958 e hoje se tornou em uma das marcas mais tradicionais de Salinas, onde é envelhecida em tonéis de Bálsamo, e engarrafada em vidro escuro com tampa de metal. O envelhecimento em tonéis de Bálsamo deixa a cachaça na cor dourada, o que dá a ela um sabor ligeiramente semelhante ao de amêndoa. De cor brilhante e viscosidade perfeita, a cachaça Indaiazinha tem forte presença do Bálsamo no aroma e no sabor, que persistem longamente.',227.8,3,2,_binary 'data:application/octet-stream;base64,'),(24,'Aguardente Nega Fulo 750ml','Produzida desde a década de 1970, foi a primeira a ser fabricada na Fazenda Soledade, em Nova Friburgo. O processo de produção, que hoje alia inovações tecnológicas ao método que deu origem à tão famosa bebida artesanal, usa água pura das nascentes de altitude da fazenda. A cachaça é diluída entre a primeira e segunda destilação, e cerca de 50% de sua composição vem das nascentes da região. O reconhecimento é internacional: a marca foi comprada pela Diageo, maior empresa de bebidas do mundo, responsável por rótulos como Jose Cuervo, Smirnoff, Johnnie Walker e Guinness. Mas mesmo após a aquisição da multinacional, a fabricação continua contanto com os irmãos Bastos Ribeiro, que asseguram pessoalmente a qualidade do produto.',67.5,3,3,_binary 'data:application/octet-stream;base64,'),(25,'Aguardente Nega Fulo Terracota 700ml','Cachaça guardada forte e pura em tonéis de carvalho, o que a enobrece, apura o sabor, refina o gosto e aviva a cor. A embalagem de Nêga Fulô Terracota é obra do premiado escultor Geraldo Simplício, o Nêgo. Trata-se de uma botija de terracota, de concepção artesanal; tanto na forma como no material utilizado - argila modelada, queimada em forno. O resultado é uma obra inédita, original e decorativa, sendo o primeiro recipiente em terracota a harmonizar arte e design comercial. Assim como o produto, esta embalagem também é produzida em quantidade limitada!',93.5,3,2,_binary 'data:application/octet-stream;base64,'),(26,'Aguardente Ypioca 150 anos 700ml','Reserva especial comemorativa aos 150 anos da Ypioca. Aguardente extrapremium envelhecida 3 anos em tonel de bálsamo e 3 anos em tonel de carvalho, tornando-a complexa e refinada. Deve ser degustada pura para que se possa sentir todos os seus aromas e sabores.',67.5,3,3,_binary 'data:application/octet-stream;base64,'),(34,'Vinho Villa Lobos Cabernet Sauvignon','Vinho elegante e complexo, de cor vermelha rubi brilhante. Aromas delicados que destacam notas de frutas vermelhas maduras como cassis e um suave toque de especiarias provenientes da uva Cabernet Sauvignon, com notas suaves de baunilha, café e chocolate obtidos da maturação por 12 meses em barrica de carvalho francês. Em boca apresenta bom corpo, acidez equilibrada e taninos maduros que oferecem uma persistência gustativa longa e agradável.',155.9,4,4,_binary 'data:application/octet-stream;base64,'),(35,'Vinho Yellow Tail Shiraz','Coloração rubi intenso. Aromas de especiarias, alcaçuz e geleia de frutas vermelhas. Na boca uma explosão de frutas pretas seguidas pelo suave sabor da baunilha, com doçura perfeitamente equilibrada com taninos suaves.',37.3,4,5,_binary 'data:application/octet-stream;base64,'),(36,'Vinho Verde Casal Garcia Branco 750ml','Amarelo palha com toques esverdeado. Delicado, levemente frutado, com toques florais. Suave, fresco, jovem, equilibrado. Boa acidez. Aspecto límpido e ligeiramente efervescente.',35.33,4,4,_binary 'data:application/octet-stream;base64,'),(37,'Vinho Piscine Rose','Jacques Tranier, o presidente da Vinovalie, um grupo de produtores do Sudoeste francês, estava de férias em 2003 perto de Saint Tropez, na Côte d’Azur, quando num bar viu o garçom servir vinho rosé em taças de Cognac com gelo. A maioria das pessoas que pedia eram mulheres e bebiam isto do início ao final da refeição, do aperitivo ao digestivo. Curioso pediu uma taça, mas o vinho se por um lado estava geladinho e refrescante graças ao gelo, por outro ficava aguado, diluído e sem sabor. O conceito estava ali, mas faltava o produto. De volta ao batente pediu aos enólogos da casa que se debruçassem sobre o problema e que achassem uma solução. Enquanto isso Jacques ficou pensando no nome e na embalagem. Cores que remetessem ao verão e à Côte d’Azur que o inspirou. Praia, piscina, vinho rosé, gelo, taça grande... o “brain storm” no marketing apontou a solução: Rosé Piscine.',93.5,4,2,_binary 'data:application/octet-stream;base64,'),(38,'Vinho Verde Casal Garcia Rose 750ml','Cor rosada com um aspecto límpido e ligeiramente efervescente. Aroma frutado sobressaindo notas de framboesa e morango. Paladar continua evidente notas de frutas vermelhas, bem conjugada com uma acidez equilibrada que confere a este vinho um grande frescor, uma estrutura sólida e um final harmonioso e de persistência suave.',38.4,4,6,_binary 'data:application/octet-stream;base64,'),(39,'Vinho Infinitum Primitivo IGT 750ml','Elaborado a partir de vinhas plantadas na área de Manduria e Sava este tinto agradável e redondo elaborado a partir de uma das uvas símbolo da Puglia é um daqueles vinhos fáceis de gostar. No nariz revela notas de frutas vermelhas maduras, chocolate e toques de eucalipto e canela, com taninos sedosos e agradável doçura em boca. Um vinho fácil de agradar para beber aos goles. Cor rubi intenso com reflexos violáceos. Aroma frutas vermelhas, como cerejas, amoras, cassis e morangos maduros, notas herbáceas, chocolate e toques de especiarias doces, como eucalipto. Paladar médio corpo, com taninos maduros e aveludados, e bom frescor. Seu final de boca é sutilmente doce, com notas de frutas vermelhas maduras e toques de especiarias doces e chocolate.',39.9,4,2,_binary 'data:application/octet-stream;base64,'),(40,'Vinho La Piu Belle 750ml','Vinho de cor rubi evoluída e uma auréola intensa. Aromas notavelmente intensos e bem equilibrados, começando com bagas delicadas, flores silvestres, especiarias e um toque de carvalho que torna o vinho mais complexo, mas amigável ao mesmo tempo. No palato é incrivelmente fresco, sedoso, com corpo e estrutura. Os taninos são redondos e elegantes, com um longo acabamento.',467,4,2,_binary 'data:application/octet-stream;base64,'),(41,'Vinho do Porto Ferreira Branco 750ml','Ferreira Branco é um Vinho do Porto branco clássico, um vinho atrativo e rico, com o sabor genuíno dos melhores vinhos produzidos na região do Douro com o cuidado e saber acumulado ao longo de mais de 250 anos de excelência. Porto Ferreira Branco tem uma bonita cor amarelo-palha e aromas frescos mas intensos, com atrativas nuances florais e de fruta. Macio e muito equilibrado na boca, é um vinho rico e cheio, com a complexidade e nobreza que lhe advém de um cuidadoso envelhecimento em madeira.',57.1,4,3,_binary 'data:application/octet-stream;base64,'),(42,'Vinho Callia Malbec','Vinho de cor vermelho escuro. Aromas de frutas vermelhas como ameixas e cerejas, característicos da Malbec. Em boca grande frescura, equilíbrio, boa estrutura e taninos maduros. Ideal no acompanhamento de carne assada, churrasco ou parrilla.',36.3,4,2,_binary 'data:application/octet-stream;base64,'),(43,'Cooler Corona Aluminio 15L','Chegou o Cooler Corona. Um produto para você que escolheu explorar paisagens e colecionar momentos. Mergulhe em um universo de sensações.',175.8,5,2,_binary 'data:application/octet-stream;base64,'),(44,'Taça Bordeau Gastro 650ml (Crystalite Bohemia)','Este vidro possui grande refração de luz, pode ser lavado em lava-louças sem a ameaça de ficar cinza, e tem uma longa vida útil graças à infusão de titânio.A Crystalite Bohemia foi fundada em outubro de 2009 e hoje possui uma planta de produção em Svetla nad Sazavou (desde 1967) com produção totalmente automatizada de bebidas e vidro decorativo para hotéis, restaurantes, butiques e residências. Nós usamos o CRYSTALITE de vidro sem chumbo ambientalmente amigável.',14.5,5,3,_binary 'data:application/octet-stream;base64,'),(45,'Taça Bordeau Gastro Champagne 220ml (Crystalite Bohemia)','Este vidro possui grande refração de luz, pode ser lavado em lava-louças sem a ameaça de ficar cinza, e tem uma longa vida útil graças à infusão de titânio.A Crystalite Bohemia foi fundada em outubro de 2009 e hoje possui uma planta de produção em Svetla nad Sazavou (desde 1967) com produção totalmente automatizada de bebidas e vidro decorativo para hotéis, restaurantes, butiques e residências. Nós usamos o CRYSTALITE de vidro sem chumbo ambientalmente amigável.',14.5,5,2,_binary 'data:application/octet-stream;base64,'),(46,'Injetor de Temperos Tramontina 30ml','O sal do churrasco tem que ser grosso. Já o churrasqueiro pode (e deve) ser refinado. Foi para ele que a Tramontina criou uma linha completa de acessórios. São aventais, barras magnéticas, sopradores e muitos outros produtos que mostram quem é especialista na arte de churrasqueada.',46.7,5,3,_binary 'data:application/octet-stream;base64,'),(47,'Caixa Pinus de Madeira para uma Garrafa com Acessórios','Caixa Pinus de Madeira para uma Garrafa com Acessórios. Ótima opção de presente.',145.5,5,3,_binary 'data:application/octet-stream;base64,'),(48,'Kit Boccati Sommelier para Vinhos','Kit sommelier Boccati, com:1 Saca rolha dois estágios/1 Corta capsula/1 Salva gotas anel em metal.',67.5,5,2,_binary 'data:application/octet-stream;base64,'),(49,'Kit Saca Rolhas Oster Inspire','Um kit desenvolvido para os amantes do vinho. Acessórios que facilitam a experiência de degustação e acabamento em aço inox escovado, que traz todo o requinte que os bons vinhos merecem. Prático cortador de lacres de alumínio. Elegante abridor elétrico de vinho que funciona com 4 pilhas AA, basta apertar um botão para remover a rolha. Bomba a vácuo que elimina o ar da garrafa, mantendo as propriedades do vinho por mais tempo. Vem em um moderno e prático estojo em couro sintético para acomodar todos os acessórios. O Kit para Vinhos Inspire Oster® conta ainda com um anel antigotas e dosador para o bico da garrafa.Todos os acessórios que você precisa, em um lugar. Kit para Vinhos Inspire Oster®, muito mais que um presente.',25.8,5,4,_binary 'data:application/octet-stream;base64,'),(50,'Vinho Ventisquero Reserva Chardonnay','Amarelo palha. Complexo e delicado, ressalta aromas de frutas como abacaxi, pêssego, papaia, lima, pomélo e notas minerais. Paladar redondo e suave, com boa acidez, que mantém seu frescor.',34.48,4,3,_binary 'data:application/octet-stream;base64,');
